import React from 'react';

const NewHome = () => {
	return (
		<div className="headerMain">
			<div className="headerContentContainer">
				<h1> Hey, I'm Matt!</h1>
				<h3 className="lightText70 max-width700">
					I'm a <span className="off"> senior product designer </span>, an energetic lad, a coding enthusiast,
					a dog lover & a waterfall fantastic !
				</h3>

				<div>
					<p className="badge">Available for full-time opportunities </p>
				</div>
			</div>
		</div>
	);
};

export default NewHome;
